// Setting up social profiles

import emailIcon from '../assets/email_icon.png';
import githubIcon from '../assets/github_icon.png';
import linkedinIcon from '../assets/linkedin_icon.png';

const SOCIAL_PROFILES = [
  {
    id: 1,
    link: 'mailto:romanqramirez@gmail.com',
    image: emailIcon,
  },
  {
    id: 2,
    link: 'https://github.com/romanramirez',
    image: githubIcon,
  },
  {
    id: 3,
    link: 'https://www.linkedin.com/in/robertsterlingramirez/',
    image: linkedinIcon,
  },
  // {
  //   id: 4,
  //   link: 'https://twitter.com',
  //   image: twitterIcon,
  // },
];

export default SOCIAL_PROFILES;
